    def getresult(self,open_id,token):

        # 获取风控结果
        url = self.baseURL + "/gateway/risk/result/%s"%open_id

        # 获取风控请求的openid

        headers = {"Content-Type": "application/json", "charset": "utf-8", "x-token": token}

